            // padding: 0px 0px 0px 0px;
        }

        .card {
            height: 40px;
            width: 80vw;
            max-width: 500px;
            border: none;
            background: rgba(0,0,0, 0);
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            padding: 0rem 0rem;
            margin: 1rem 0rem;
            opacity: 1;

            .text {
                transform: rotate(0deg);
                font-size: 10vmin;
            }
        }

        .footer-container {
            position: absolute;
            bottom: 50px;
            height: 125px;
            width: 100vw;
            display: flex;
            flex-direction: column;
            align-items: center;

